import React from "react";
import { NavLink, BrowserRouter } from "react-router-dom";
import AddPatients from "../pages/AddPatients";
import SearchPatients from "../pages/SearchPatients";



const NavBar = () =>{

    return (
        <>
            <BrowserRouter >
                <nav className="flex flex-col justify-between bg-slate-600 items-center float-left h-lvh w-50 content-center text-white mr-10">
                    <NavLink
                        to='/addPatients'
                        element={<AddPatients />} 
                        name='addPatients'
                        class="h-[50vh] w-40"
                        className={({ isActive }) => isActive ? "text-black" : ""
                          }
                        >
                        <div className="grid grid-cols-1 gap-4 place-items-center size-full">
                            <h1>Add <br></br>Patients</h1>
                            <h1>+</h1>
                        </div>
                    </NavLink>
                    <NavLink
                        to="/searchPatients"
                        element={<SearchPatients />} 
                        name='addPatients'
                        className="h-[50vh] w-40"
                    >
                        <div className="grid grid-cols-1 gap-4 place-items-center size-full">
                            <h1>Search <br></br>Patients</h1>
                            <h1>0</h1>
                        </div>
                    </NavLink>
                </nav>
            </BrowserRouter >
        </>
    )
}

export default NavBar;
